import React from 'react';
import Trash from '../assets/Trash';

export default class Home extends React.Component {
  constructor(props: any) {
    super(props);
  };

  render() {
    return (
    <div>
      <div className="card-container">
      <header className="card-header">Sgt. Pepper's Lonely Hearts Club Band (1967)</header>
        <div className="role-radios">
          <input className="radio-inputs" type="radio" name="portalRole" value="Admin"/>Admin
          <input className="radio-inputs" type="radio" name="portalRole" value="Writer"/>Writer
          <input className="radio-inputs" type="radio" name="portalRole" value="Reader"/>Reader
        </div>
            <Trash/>
      </div>

    </div>
    );
  }
}
